import "./header.css";
import Navbar from "./Navbar";
import pic1 from "../img/pic1.jpg";
import pic2 from "../img/pic2.jpg";
export default function Header() {
  return (
    <div classname="navbar">
      <Navbar></Navbar>
      <div className="header">
        <div className="headerTitles">
          <span className="headerTitle">Choi WooSun</span>
        </div>
        <div >
          <div class = "container">
            <div class = "inner">
            <img
              className="headerImg"
              src="https://gearbox.imgix.net/https%3A%2F%2Fix-www.imgix.net%2Fsolutions%2Fbeach.jpg?w=1782&h=982&fit=crop&ixlib=js-2.0.0&s=696f7285735b866832b0d79abb471548"
              alt=""
            ></img>
            </div>
          </div>
        </div>
        <button class="버튼1">1</button>
        <button class="버튼2">2</button>
        <button class="버튼3">3</button>

      </div>
    </div>
  );
}
